static void CheckRefIsNull(void* node, const char* ref, int line)
{
	if (!node)
	{
		printf("Error Unfind Ref: %s, len: %d\n", ref, line);
	}
}

/**
* @brief :初始化模型
* @param  void
* @return: 初始化成功是否成功
* @update: [2018-08-15][创建]
*/
bool LogicalDeviceDataRefInit(IedModel* model)
{
	char ref[129] = { 0 };
	if (strlen(model->name) > 129)
	{
		perror("strlen(model->name) > 129\n");
		return false;
	}
//	CurrentIedModel = model;
	//LLN0 节点
	strcat(ref, model->name);
	strcat(ref, "LD0");
	IED_LD0 = IedModel_getDevice(model, ref);
	ref[0] = 0;
	strcat(ref, model->name);
	strcat(ref, "MEAS");
	IED_MEAS = IedModel_getDevice(model, ref);
	ref[0] = 0;
	strcat(ref, model->name);
	strcat(ref, "CTRL");
	IED_CTRL = IedModel_getDevice(model, ref);
	ref[0] = 0;
	strcat(ref, model->name);
	strcat(ref, "PROT");
	IED_PROT = IedModel_getDevice(model, ref);

	DataRefInit();
    return true;
}
